This package comes with Gravity Forms v1.8.9 and Gravity Forms Styler v1.2 Add-on

Gravity forms:
Gravity Forms is hands down the best contact form plugin for WordPress powered websites. Build and publish your 

WordPress forms in just minutes. No drudgery, just quick and easy form-building. Select your fields, configure your 

options and easily embed forms on your WordPress powered site using the built-in tools. That's way more satisfying (and 

less fattening) than a peanutty candy bar any day.

Gravity Forms Styler Add-on:
You can create and apply beautiful styles to your gravity forms standard fields, advanced fields, titles and 

descriptions, buttons, form borders, form labels, form backgrounds and you can even customize the form confirmation and error messages.

